import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { NotificationsNone, Settings } from '@material-ui/icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome, faUserAlt, faSignOutAlt,  faListAlt } from '@fortawesome/free-solid-svg-icons';
import { useNavigate } from "react-router-dom";

// Import useUser from your context file
import { useUser } from './Usercontext'; 

const UserNavbar = () => {
  const [showDropdown, setShowDropdown] = useState(false);
  const navigate = useNavigate();
  const { state: userData, logout, login, isAuthenticated } = useUser();

  const toggleDropdown = () => {
    setShowDropdown(!showDropdown);
  };

  const handleLogout = () => {
    logout();
    navigate("/User/login");
  };

  return (
    <nav className="bg-red sticky top-0 z-50">
      <div className="container mx-auto p-7 flex items-center justify-between">
        {/* App Home Link */}
        <div className="flex items-center ml-auto space-x-4">
          <Link to="/" className="text-white mr-4 font-bold">
            <FontAwesomeIcon icon={faHome} size="lg" />
            <span className="ml-2">Home</span>
          </Link>
        </div>

        <div className="flex items-center ml-auto space-x-20">
          {/* Notifications Icon */}
          <div className="relative cursor-pointer text-gray topbarIconContainer">
            <NotificationsNone className="h-6 w-6" />
            <span className="absolute top-0 right-0 w-3 h-3 bg-red text-white rounded-full flex items-center justify-center text-xs topIconBadge">2</span>
            <span className="ml-2">Notifications</span>
          </div>

          {/* Profile Dropdown */}
          {isAuthenticated && (
            <div className="relative cursor-pointer text-gray" onClick={toggleDropdown}>
              <div className="flex items-center">
                <FontAwesomeIcon icon={faUserAlt} size="lg" />
                <span className="ml-2">{userData.userName}</span> {/* Render user name */}
              </div>
              {showDropdown && (
                <div className="absolute mt-2 p-2 bg-white text-gray-800 shadow-lg rounded">
                  {/* Different links based on user type (donor or recipient) */}
                  <Link to="/donor-profile" className="block py-2">
                    Donor Profile
                  </Link>
                  <Link to="/recipient-profile" className="block py-2">
                    Recipient Profile
                  </Link>
                  <Link to="/appointments" className="block py-2">
                    My Appointments
                  </Link>
                  <Link to="/blood-donation-history" className="block py-2">
                    Blood Donation History (for Donors only)
                  </Link>
                  <Link to="/blood-request-history" className="block py-2">
                    Blood Request History (for Recipients only)
                  </Link>
                </div>
              )}
            </div>
          )}

          {/* Blood Requests/Donations (based on user type) */}
          {isAuthenticated && (
            <Link to="/blood-requests" className="text-white">
              <FontAwesomeIcon icon={faListAlt} size="lg" />
              <span className="ml-2">Blood Requests (Donors) / Donations (Recipients)</span>
            </Link>
          )}

          {/* Logout Icon */}
          {isAuthenticated && (
            <div className="relative cursor-pointer text-gray">
              <Link to="/logout" className="text-white" onClick={handleLogout}>
                <FontAwesomeIcon icon={faSignOutAlt} size="lg" />
                <span className="ml-2">Logout</span>
              </Link>
            </div>
          )}

          {/* Settings Icon */}
          <div className="relative cursor-pointer text-gray-500">
            <Settings className="h-6 w-6" />
            <span className="ml-2">Settings</span>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default UserNavbar;
